import React from 'react'
import CreateIcon from '@mui/icons-material/Create';
import DeleteIcon from '@mui/icons-material/Delete';
import EmailIcon from '@mui/icons-material/Email';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';

const View = () => {
  return (
    <div className='container'>
      <h1 style={{fontWeight:350}}>Welcome Akash Singh</h1>

      <Card sx={{ maxWidth: 275 }}>
        <CardContent>
          <div className='left_view'>
            <img src='/profile.png' style={{width: 55}} alt='profile' />
            <h3 className='mt-3'>Name: <span style={{fontWeight: 350}}>Akash Singh</span></h3>
            <h3 className='mt-3'>Branch: <span style={{fontWeight: 350}}>Information Technology</span></h3>
            <h3 className='mt-3'><CalendarMonthIcon /> DoB: <span style={{fontWeight: 350}}>21/05/2001</span></h3>
            <p><EmailIcon /> Email: <span>akashsingh@gmail.com</span></p>
            <p>Mobile: <span>1234567890</span></p>

          </div>
        </CardContent>
      </Card>
    </div>
  )
}

export default View
